function flattenToString(obj) {
  try {
  	s.events = s.apl(s.events, 'event871', ",", 1);
    var stringObj = "";
    Object.keys(obj).map(function (key) {
      if (Array.isArray(obj[key])) {
        if (obj[key].length <= 0){ return; }
        return stringObj += key + ":" + obj[key] + ";";
      }
      if (obj[key] && typeof obj[key] === "object") {
        stringObj += flattenToString(obj[key]);
      } else if (obj[key] != null && obj[key] != "" || typeof obj[key] === "boolean") {
        return stringObj += key + ":" + obj[key] + ";";
      }
    });
   return stringObj;
  } catch (err) {
    console.log("flattenToString function: " + err.message);
  }
}

function parseListData(data) {
    if (Array.isArray(data)) { // assumed to be listings
        return flattenShallowArrayToString(data);
    } else { // assumed to be allCriteria  
        return flattenToString2(data);
    }
}

function flattenToString2(obj, parentKeys) {
    parentKeys = parentKeys || []; 
    s.events = s.apl(s.events, 'event848', ",", 1);
    var stringObj = ""
    Object.keys(obj).map(function (key) {
        if (Array.isArray(obj[key])) {
            if (obj[key].length <= 0){ 
                return; 
            }
            return stringObj += (parentKeysOrEmptyString(parentKeys) + key + ":" + obj[key] + ";");
        }
        if (obj[key] && typeof obj[key] === "object") {
            parentKeys.push(key);
            stringObj += flattenToString2(obj[key], parentKeys);
            parentKeys = [];
        } else if (obj[key] != null && obj[key] != "" || typeof obj[key] === "boolean") {
            return stringObj += (parentKeysOrEmptyString(parentKeys) + key + ":" + obj[key] + ";");
        }
    });
    return stringObj;
}

function parentKeysOrEmptyString(parentKeys) {
    return (parentKeys && parentKeys.length > 0) ? (parentKeys.join(".") + ".") : "";
}

function flattenShallowArrayToString(arr) { // expected input: [ { key: value}, { key: value }, ... ]
    s.events = s.apl(s.events, 'event848', ",", 1); 
    if (arr.length <= 0) {
        return "";
    }
    return arr.map(function(item) {
        return Object.keys(item).map(function(objKey) {
            return objKey + ":" + item[objKey]
        }).join(",");
    }).join(";");
}

